import React, { Component } from 'react';
import Logo from './Logo';
import ProfilePic from './ProfilePic';

class Header extends Component
{
    render()
    {
        return (
            <div className="header bg-dark"> 
               
               <ProfilePic></ProfilePic>
                <Logo></Logo>
                
            </div>
        );
    }
}

export default Header;
